import React from 'react'

export default function FIlterForm() {
  return (
    <div>
        <label>
            <input type="text" placeholder='min' name='min'/>
            <input type="text" placeholder='max' name='max'/>
            <button>Filter</button>
        </label>
    </div>
  )
}
